module.exports = {
  parser: "@babel/eslint-parser",
  parserOptions: {
    sourceType: "module",
    ecmaFeatures: {
      jsx: true,
    },
  },
  settings: {
    react: {
      version: "detect",
    },
  },
  extends: [
    "eslint:recommended",
    "plugin:@typescript-eslint/eslint-recommended",
    "plugin:@typescript-eslint/recommended",
    //'plugin:@typescript-eslint/recommended-requiring-type-checking',
    "plugin:import/errors",
    "plugin:import/typescript",
    "plugin:graphile-export/recommended",
    "prettier",
  ],
  plugins: [
    "jest",
    "graphql",
    "tsdoc",
    "simple-import-sort",
    "import",
    "graphile-export",
    "react-hooks",
  ],
  env: {
    jest: true,
    node: true,
    es6: true,
  },
  globals: {
    jasmine: false,
  },
  rules: {
    "@typescript-eslint/ban-ts-comment": "off",
    "@typescript-eslint/ban-ts-ignore": "off",
    "@typescript-eslint/camelcase": "off",
    "@typescript-eslint/no-empty-function": "off",
    "@typescript-eslint/no-empty-interface": "off",
    // We need this for our `GraphileEngine` namespace
    "@typescript-eslint/no-namespace": "off",
    "@typescript-eslint/no-use-before-define": "off",
    "@typescript-eslint/no-var-requires": "off",
    "@typescript-eslint/consistent-type-imports": "error",
    "no-confusing-arrow": 0,
    "no-else-return": 0,
    "no-underscore-dangle": 0,
    "no-restricted-syntax": 0,
    "no-await-in-loop": 0,
    "jest/no-focused-tests": 2,
    "jest/no-identical-title": 2,
    "tsdoc/syntax": 2,

    // Rules that we should enable:
    "@typescript-eslint/no-inferrable-types": "warn",
    "no-inner-declarations": "warn",

    // Rules we've disabled for now because they're so noisy (but we should really address)
    "@typescript-eslint/no-explicit-any": "off",
    "@typescript-eslint/no-non-null-assertion": "off",
    "@typescript-eslint/no-unused-vars": [
      "error",
      {
        argsIgnorePattern: "^_",
        varsIgnorePattern: "^_",
        args: "after-used",
        ignoreRestSiblings: true,
      },
    ],

    /*
     * simple-import-sort seems to be the most stable import sorting currently,
     * disable others
     */
    "simple-import-sort/imports": "error",
    "simple-import-sort/exports": "error",
    "sort-imports": "off",
    "import/order": "off",

    "import/extensions": ["error", "ignorePackages"],
    "import/no-deprecated": "warn",

    // Apply has been more optimised than spread, use whatever feels right.
    "prefer-spread": "off",

    // note you must disable the base rule as it can report incorrect errors
    "no-duplicate-imports": "off",
    "import/no-duplicates": "error",
  },
  overrides: [
    // Rules for core plugins
    {
      files: [
        "graphile-build/graphile-build/src/plugins/**/*.ts",
        "graphile-build/graphile-build-pg/src/**/*.ts",
      ],
      rules: {
        "no-restricted-syntax": [
          "error",
          {
            selector:
              "ImportDeclaration[importKind!='type'][source.value='graphql']",
            message:
              "Please refer to `build.graphql` instead, or use `import type` for type-only imports. (This helps us to avoid multiple `graphql` modules in the `node_modules` tree from causing issues for users.)",
          },
        ],
      },
    },

    // Rules for non-core plugins
    {
      files: ["graphile-build/graphile-utils/src/**/*.ts"],
      rules: {
        "no-restricted-syntax": [
          "error",
          {
            selector:
              "ImportDeclaration[importKind!='type'][source.value='graphql']",
            message:
              "Please refer to `build.graphql` instead, or use `import type` for type-only imports. (This helps us to avoid multiple `graphql` modules in the `node_modules` tree from causing issues for users.)",
          },
          {
            selector:
              "ImportDeclaration[importKind!='type'][source.value='grafast']",
            message:
              "Please refer to `build.grafast` instead, or use `import type` for type-only imports. (This helps us to avoid multiple `grafast` modules in the `node_modules` tree from causing issues for users.)",
          },
        ],
      },
    },

    // Rules for interfaces.ts files
    {
      files: ["**/interfaces.ts"],
      rules: {
        "no-restricted-syntax": [
          "error",
          {
            selector: "TSModuleDeclaration[kind='global']",
            message:
              "No `declare global` allowed in `interface.ts` files since these type-only files may not be imported by dependents, recommend adding to `index.ts` instead.",
          },
        ],
      },
    },

    // Rules for TypeScript only
    {
      files: ["*.ts", "*.tsx"],
      parser: "@typescript-eslint/parser",
      rules: {
        "no-dupe-class-members": "off",
        "no-undef": "off",
        // This rule doesn't understand import of './js'
        "import/no-unresolved": "off",
      },
    },

    // Rules for JavaScript only
    {
      files: ["*.js", "*.jsx", "*.mjs", "*.cjs"],
      rules: {
        "tsdoc/syntax": "off",
        "import/extensions": "off",
      },
    },

    // Stricter rules for source code
    {
      files: ["*/*/src/**/*.ts", "*/*/src/**/*.tsx"],
      parser: "@typescript-eslint/parser",
      parserOptions: {
        project: true,
      },
      rules: {},
    },

    // Rules for tests only
    {
      files: ["**/__tests__/**/*.{ts,js}"],
      rules: {
        // Disable these to enable faster test writing
        "prefer-const": "off",
        "@typescript-eslint/no-explicit-any": "off",
        "@typescript-eslint/no-unused-vars": "off",
        "@typescript-eslint/explicit-function-return-type": "off",

        // We don't normally care about race conditions in tests
        "require-atomic-updates": "off",
      },
    },

    // React rules
    {
      files: [
        "grafast/ruru/src/**/*.ts",
        "grafast/ruru/src/**/*.tsx",
        "**/website/src/**",
      ],
      extends: ["plugin:react/recommended"],
      rules: {
        "react-hooks/rules-of-hooks": "error",
        "react-hooks/exhaustive-deps": [
          "warn",
          {
            enableDangerousAutofixThisMayCauseInfiniteLoops: true,
          },
        ],

        // Stuff I don't care about
        "react/react-in-jsx-scope": "off",
        "react/prop-types": "off",
      },
    },

    {
      files: [
        "**/vendor/**/__tests__/**/*.ts",
        "**/vendor/**/__tests__/**/*.tsx",
        "**/vendor/**/__testUtils__/**/*.ts",
        "**/vendor/**/__testUtils__/**/*.tsx",
        "**/website/examples/**",
        "graphile-build/graphile-utils/__tests__/*Plugin.ts",
      ],
      rules: {
        "graphile-export/exhaustive-deps": 0,
        "graphile-export/export-methods": 0,
        "graphile-export/export-instances": 0,
        "graphile-export/export-subclasses": 0,
        "graphile-export/no-nested": 0,
      },
    },

    {
      files: ["**/website/**"],
      rules: {
        "import/no-unresolved": "off",
      },
    },

    // Don't use Node.js builtins
    {
      files: ["grafast/grafast/src/**", "utils/graphile-config/src/**"],
      excludedFiles: ["utils/graphile-config/src/loadConfig.ts"],
      rules: {
        "@typescript-eslint/no-restricted-imports": [
          "error",
          {
            paths: [
              "assert",
              "buffer",
              "child_process",
              "cluster",
              "crypto",
              "dgram",
              "dns",
              "domain",
              "events",
              "freelist",
              "fs",
              "fs/promises",
              { name: "http", allowTypeImports: true },
              "https",
              "module",
              "net",
              "os",
              "path",
              "punycode",
              "querystring",
              "readline",
              "repl",
              "smalloc",
              "stream",
              "string_decoder",
              "sys",
              "timers",
              "tls",
              "tracing",
              "tty",
              "url",
              "util",
              "vm",
              "zlib",
            ],
            patterns: ["node:*"],
          },
        ],
      },
    },
  ],
};

module.exports = require("babel-jest").default.createTransformer({
  rootMode: "upward",
});

module.exports = {
  trailingComma: "all",
  proseWrap: "always",
  overrides: [
    {
      files: "CRYSTAL_FLOW.md",
      options: {
        printWidth: 120,
      },
    },
    {
      // Due to the following Prettier issue, it's unsafe to proseWrap MDX currently
      // https://github.com/prettier/prettier/issues/13586
      files: ["**/website/**/*.mdx", "**/website/**/*.md"],
      options: {
        proseWrap: "preserve",
      },
    },
    {
      files: "grafast/grafast/vendor/graphql-js/**",
      options: {
        singleQuote: true,
      },
    },
  ],
};

// Babel config, used by Jest
module.exports = {
  plugins: ["@babel/plugin-transform-modules-commonjs"],
  presets: [
    [
      "@babel/env",
      {
        targets: {
          node: "16.12",
        },
      },
    ],
    "@babel/preset-typescript",
    "@babel/preset-react",
  ],
  env: {
    test: {
      plugins: ["babel-plugin-transform-import-meta"],
      presets: [
        [
          "@babel/env",
          {
            targets: {
              node: "current",
            },
          },
        ],
        "@babel/preset-typescript",
      ],
    },
  },
};

const child_process = require("child_process");
const { readFileSync } = require("fs");

const output = child_process.execSync(
  "yarn workspaces list --json --recursive --no-private",
  {
    encoding: "utf8",
  },
);

// TODO: handle special characters if any
const mermaidEscape = (str) => str;

const nodeName = (str) => str.replace(/[^a-z0-9]+/g, "_");

/** @type {Array<{location: string, name: string}>} */
const workspaces = JSON.parse(
  "[" + output.replace(/\n/g, ",").replace(/,+$/, "") + "]",
).sort((a, z) => a.location.localeCompare(z.location, "en-US"));

const workspaceModuleNames = workspaces.map((w) => w.name);

/** @type {{[name: string]: string[]}} */
const groups = Object.create(null);
const relations = [];

for (const workspace of workspaces) {
  const i = workspace.location.lastIndexOf("/");
  const groupName = i >= 0 ? `~/${workspace.location.substring(0, i)}` : `~`;
  if (!groups[groupName]) {
    groups[groupName] = [];
  }
  groups[groupName].push(
    nodeName(workspace.name) + `["${mermaidEscape(workspace.name)}"]`,
  );
  const packageJson = JSON.parse(
    readFileSync(`${workspace.location}/package.json`, "utf8"),
  );
  for (const moduleName of Object.keys(packageJson.dependencies ?? {})) {
    if (workspaceModuleNames.includes(moduleName)) {
      relations.push(`${nodeName(moduleName)} --> ${nodeName(workspace.name)}`);
    }
  }
}

/** @type {Array<string>} */
const diagramLines = [`graph TD`];
for (const groupName in groups) {
  const mods = groups[groupName];
  diagramLines.push(
    `    subgraph ${nodeName(groupName)} "${mermaidEscape(groupName)}"`,
  );
  for (const mod of mods) {
    diagramLines.push(`      ${mod}`);
  }
  diagramLines.push(`    end`);
}
for (const relation of relations) {
  diagramLines.push(`    ${relation}`);
}

console.log(diagramLines.join("\n"));

if (!("GRAPHILE_ENV" in process.env)) {
  process.env.GRAPHILE_ENV = "test";
}
module.exports = (dir) => {
  const packageJson = require(`${dir}/package.json`);

  return {
    testEnvironment: "node",
    transform: {
      "^.+\\.jsx?$": `${__dirname}/.jest-babel-transform.js`,
      "^.+\\.tsx?$": `${__dirname}/.jest-babel-transform.js`,
    },
    testMatch: ["<rootDir>/**/__tests__/**/*.test.[jt]s?(x)"],
    moduleFileExtensions: ["js", "json", "jsx", "ts", "tsx", "node"],
    roots: [`<rootDir>`],
    snapshotSerializers: [
      `${__dirname}/utils/jest-serializer-graphql-schema`,
      `${__dirname}/utils/jest-serializer-simple`,
    ],
    extensionsToTreatAsEsm: [".ts"],
    moduleNameMapper: {
      "^(\\.{1,2}/.*)\\.js$": "$1",
    },

    rootDir: dir,
    // name: packageJson.name,
    displayName: packageJson.name,
    globals: {
      /*
      "ts-jest": {
        // Ref: https://github.com/votingworks/ballot-encoder/pull/13/files/b5bbb770c1cc0777c0aee1455b61497afd46cccd#r381505804
        // ts-jest assumes it can walk up from its location on disk to find
        // package.json, but this is not true when operating in the yarn PnP
        // virtual file system. Instead, we provide it directly.
        packageJson,
      },
      */
    },

    setupFiles: [`${__dirname}/__tests__/setup-mock-fs.ts`],
    // Jest doesn't currently support prettier v3; see https://github.com/jestjs/jest/issues/14305
    prettierPath: require.resolve("@localrepo/prettier2-for-jest"),
  };
};

module.exports = {
  projects: [
    "<rootDir>/utils/*/jest.config.js",
    "<rootDir>/grafast/*/jest.config.js",
    "<rootDir>/graphile-build/*/jest.config.js",
    // "<rootDir>/postgraphile/*/jest.config.cjs",
  ],
};

{
  "$schema": "https://typedoc.org/schema.json",
  "entryPointStrategy": "Packages",
  "name": "Graphile GraphQL Suite",
  "readme": "README.md",
  "excludePrivate": true,
  "excludeInternal": true,
  "validation": {
    "invalidLink": true
  },
  "noMissingExports": true,
  "pluginPages": {
    "source": "pages",
    "pages": [
      {
        "title": "grafast",
        "children": [
          {
            "title": "Technical overview",
            "source": "overview.md"
          },
          {
            "title": "listTransform details",
            "source": "plans/listTransform.md"
          }
        ]
      },
      {
        "title": "@dataplan/pg",
        "children": [
          { "title": "pgPageInfo details", "source": "plans/pgPageInfo.md" }
        ]
      }
    ]
  }
}
